import React, { useState } from "react";
import {StyleSheet,View,Text,TextInput,Button} from "react-native";
import {Formik} from "formik";
import * as yup from"yup";
import {RadioButton} from "react-native-paper";
const ReviewSchema=yup.object({
    fullname:yup.string().required().min(2).max(10),
    emailid:yup.string().required(),
    qualification:yup.string(),
    placeofwork:yup.string(),
    experience:yup.string(),
    
});
export default function ChefDetails({navigation})
{
  const [chefDetails,setchefDetails]=useState({'fullname':'','emailid':'','qualification':'','placeofwork':'','experience':'','gender':1})
  const [value, setValue] = React.useState(1);  
  const onSubmitHandler=(val)=>{
      setchefDetails({
        'fullname':val.fullname,
        'emailid':val.emailid,
        'qualification':val.qualification,
        'placeofwork':val.placeofwork,
        'experience':val.experience,
        'gender':value
      })
      let gender="O"
        if(value===1)
          gender="F";
        if(value===2)
          gender="M"
        // console.log(value);
        console.log("going to other page");
        navigation.push('Location',{'type':2,'fullname':val.fullname,
        'emailid':val.emailid,
        'qualification':val.qualification,
        'placeofwork':val.placeofwork,
        'experience':val.experience,
        'gender':gender});
    }
    
    
    return (
      <View>
        <View style={styles.header}>
        <Text style={styles.headertext}>Your Details</Text>
      </View>
      <Formik initialValues={{fullname:'',emailid:'',qualification:'',placeofwork:'',experience:''}}
      validationSchema={ReviewSchema}
      onSubmit={(values,actions)=>{
          // addreview(values);
          // console.log(values);
          actions.resetForm();
          
      }}>
          {(props)=>(
              <View >
                  <Text style={styles.registerheading}>Enter Full Name</Text>
                  <TextInput style={styles.registerip} placeholder='Enter Full Name' value={props.values.fullname} onChangeText={props.handleChange('fullname')}/>
                  {/* <Text >{props.touched.fullname && props.errors.fullname}</Text> */}
                  <Text style={styles.registerheading}>Email Id</Text>
                  <TextInput style={styles.registerip} placeholder='Email Id' value={props.values.emailid} onChangeText={props.handleChange('emailid')}/>
                  {/* <Text>{props.touched.emailid && props.errors.emailid}</Text> */}
                  <Text style={styles.registerheading}>password</Text>
                  
                  <RadioButton.Group onValueChange={newValue => setValue(newValue)} value={value} >
<View style={styles.radio}>
<View style={styles.radio1}>
  
  <RadioButton color="#FC8019" title="scasc1"value={1} />
  <Text>female</Text>
</View>
<View style={styles.radio1}>
  
  <RadioButton value={2}  color="#FC8019" />
  <Text>male</Text>
</View>
<View style={styles.radio1}>
  
  <RadioButton color="#FC8019" value={3} />
  <Text>other</Text>
</View>
</View>
</RadioButton.Group>
<Text style={styles.registerheading}>qualification</Text >
                  <TextInput style={styles.registerip}  placeholder='qualification' value={props.values.qualification} onChangeText={props.handleChange('qualification')}/>
                  {/* <Text >{props.touched.fullname && props.errors.qualification}</Text> */}
                  <Text style={styles.registerheading}>Experience</Text>
                  <TextInput  placeholder='experience'  style={styles.registerip} value={props.values.experience} onChangeText={props.handleChange('experience')}/>
                  {/* <Text>{props.touched.emailid && props.errors.experience}</Text> */}
                  <Text style={styles.registerheading}>Place of work</Text>
                  <TextInput  style={styles.registerip} placeholder='place of work' value={props.values.placeofwork} onChangeText={props.handleChange('placeofwork')}/>
                  {/* <Text>{props.touched.emailid && props.errors.placeofwork}</Text> */}
                  <Button color="#FC8019" title="Continue" onPress={()=>{props.handleSubmit();onSubmitHandler(props.values)}}/>
              </View>
          )}
  </Formik>
  </View>
    )
}
const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  radio:{
    flexDirection:'row',
  },
  radio1:{
    flexDirection:'row'
  },
  registerip:{
    borderColor:"#FC8019",
    borderWidth:1.5,
  }
  ,
  registerheading:
  {
    fontSize:12,
    fontWeight:'700',
    
  },
});
